3	2	en-US	The Last Time	\N	Esa Saarinen tells it like it is	<p>The aim of Professor Esa Saarinen's lecture series Philosophy and Systems Thinking is to increase the participant's ability to think voluntarily, extensively, creatively and in a forward-thinking philosophical way of life. The aim is to create a highly enriching environment of insight in which the participant can structure their ways of working, ways of thinking and value issues in a personally relevant way. The lecture series provides tools to build and sharpen the foundations and guidelines for your own spiritual growth and life attitude. The focus is on each participant&rsquo;s own activities and lives. The aim is to strengthen everyone's ability to live creatively and value-driven in situations of change. The lectures utilize the power currents of Western and Oriental philosophy as well as the key results of modern human research and embody prof. Saarinen's experiential, holistic and atmosphere-intensive way of lecturing, in which the key role is the movement of thinking generated by the participants in the lecture situation.</p>	the-last-time
